import React from 'react';
// import './Results.css';

function Results({ results }) {
  if (!results) return null;

  return (
    <div className="results-container" id="results">
      <h2 className="text-center">Enhanced Results</h2>
      <div className="row">
        <div className="col-md-6">
          <h4>Original Image</h4>
          <img src={results.original_url} alt="Original" className="img-fluid" />
        </div>
        <div className="col-md-6">
          <h4>Enhanced Image</h4>
          <img src={results.enhanced_url} alt="Enhanced" className="img-fluid" />
        </div>
      </div>
      <div className="number-plate mt-4">
        <h5>Detected Number Plate: {results.plate_number}</h5>
      </div>
    </div>
  );
}

export default Results;
